import './App.css';
import Login from './Login';
import { BrowserRouter ,Routes ,Route } from 'react-router-dom';
function App() {
  return (
    <div>

      <BrowserRouter>
      <Routes>
         <Route path="/" element={<Login/>}/> 
        <Route path="/*" element={<Error/>}/> 
        </Routes>
      </BrowserRouter>



    </div>
  );
}
export default App;
